      'lt': '<p>Kai naudojama tik <code>grid-column-start</code>, pagal nutylÄ—jimÄ… grid elementas iÅ¡siplÄ—s tik viename stulpelyje. TaÄiau pridÄ—jus <code>grid-column-end</code> savybÄ™, galite iÅ¡plÄ—sti elementÄ… per kelis stulpelius.</p><p>Naudodami <code>grid-column-end</code>, palaistykite visas savo morkas, vengdami purvo. Mes jug nenorime Å¡vaistyti vandens! Atminkite, kad morkos prasideda pirmoje vertikalioje grid-linijoje ir baigiasi ketvirtoje.</p>',
