      'ro': '<p>CÃ¢nd proprietatea <code>grid-column-start</code> este folositÄƒ singurÄƒ, Ã®n mod implicit elementul gridului se va Ã®ntinde pe o coloanÄƒ. PoÈ›i sÄƒ extinzi elementul pe mai multe coloane adÄƒugÃ¢nd proprietatea <code>grid-column-end</code>.</p><p>Folosind <code>grid-column-end</code>, udÄƒ toÈ›i morcovii ocolind pÄƒmÃ¢ntul. Nu vrem sÄƒ risipim apÄƒ! NoteazÄƒ cÄƒ morcovii Ã®ncep la prima linie verticalÄƒ Ã®n grid È™i se terminÄƒ la a patra.</p>',
