      'az': '<p>YalnÄ±z <code>grid-column-start</code> istifad edildikdÉ™, standart olaraq grid elementi tam olaraq bir sÃ¼tun Ã¼zerinÉ™ yayÄ±lÄ±r. Bununla birlikdÉ™, <code>grid-column-end</code> Ã¶zÉ™lliyini É™lavÉ™ edÉ™rÉ™k elementi birdÉ™n Ã§ox sÃ¼tuna yaya bilÉ™rik.</p><p><code>grid-column-end</code>\'i istifadÉ™ edÉ™rÉ™k kÃ¶klÉ™rinizi sulayarkÉ™n, kirdÉ™n dÉ™ ehtiyat edin. HÉ™rhansÄ± bir suyu israf etmÉ™k istÉ™mirik! KÃ¶klÉ™rin 1. ÅŸaquli grid xÉ™ttindÉ™n baÅŸlayÄ±b 4. xÉ™ttdÉ™ bitdiyini unutmayÄ±n.</p>',
      'fr': '<p>Lorsque <code>grid-column-start</code> est utilisÃ© individuellement, l\'Ã©lÃ©ment de la grille s\'Ã©tendra par dÃ©faut sur une colonne exactement. Pourtant, vous pouvez Ã©tendre l\'Ã©lÃ©ment sur plusieurs colonnes en ajoutant la propriÃ©tÃ© <code>grid-column-end</code>.</p><p>En utilisant <code>grid-column-end</code>, arrosez toutes vos carottes tout en Ã©vitant la boue. Nous ne voulons pas gaspiller d\'eau ! Remarquez que les carottes commencent Ã  la 1Ã¨re ligne verticale de la grille et terminent Ã  la 4Ã¨me.</p>',
      'de': '<p>Wenn <code>grid-column-start</code> alleine benutzt wird, umfasst das Rasterelement standardmÃ¤ÃŸig genau eine Spalte. Du kannst den Umfang des Elements jedoch auf mehrere Spalten mit Hilfe der <code>grid-column-end</code> Eigenschaft erweitern.</p><p>Benutze <code>grid-column-end</code>, um alle Karotten zu wÃ¤ssern. Vermeide dabei die Erdabschnitte, wir wollen schlieÃŸlich kein Wasser verschwenden! Beachte, dass die Karotten auf der ersten vertikalen Rasterlinie beginnen und auf der vierten aufhÃ¶ren.</p>',
      'nl': '<p>Wanneer alleen <code>grid-column-start</code> is gebruikt, zal het griditem standaard een breedte hebben van Ã©Ã©n column. Maar je kan het verbreden over meerdere columns door de <code>grid-column-end</code>-property toe te voegen.</p><p>Met <code>grid-column-end</code> geef al je wortels water, terwijl je het braakland vermijdt. We willen geen water verspillen! Houd er rekening mee dat de wortels beginnen bij de 1e verticale gridlijn en eindigen op 4e.</p>',
      'pt-br': '<p>Quando <code>grid-column-start</code> Ã© usado sozinho, o item da grade por padrÃ£o irÃ¡ ocupar exatamente uma coluna. Entretanto, vocÃª pode extender o item atravÃ©s de mÃºltiplas colunas adicionando a propriedade <code>grid-column-end</code>.</p><p>Usando <code>grid-column-end</code>, todas suas cenouras sÃ£o irrigadas enquanto se evita uma inundaÃ§Ã£o. NÃ£o queremos desperdiÃ§ar Ã¡gua! Note que as cenouras comeÃ§am na 1Âª linha vertical da grade e terminam na 4Âª.</p>',
      'ru': '<p>ÐšÐ¾Ð³Ð´Ð° Ð²Ñ‹ Ð¸ÑÐ¿Ð¾Ð»ÑŒÐ·ÑƒÐµÑ‚Ðµ Ñ‚Ð¾Ð»ÑŒÐºÐ¾ <code>grid-column-start</code>, grid-ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚ Ð¿Ð¾ ÑƒÐ¼Ð¾Ð»Ñ‡Ð°Ð½Ð¸ÑŽ â€œÐ·Ð°Ñ…Ð²Ð°Ñ‚Ð¸Ñ‚â€ Ñ‚Ð¾Ð»ÑŒÐºÐ¾ Ð¾Ð´Ð¸Ð½ ÑÑ‚Ð¾Ð»Ð±ÐµÑ†. ÐžÐ´Ð½Ð°ÐºÐ¾ Ð²Ñ‹ Ð¼Ð¾Ð¶ÐµÑ‚Ðµ ÑƒÐ²ÐµÐ»Ð¸Ñ‡Ð¸Ñ‚ÑŒ ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚ Ð¼ÐµÐ¶Ð´Ñƒ Ð½ÐµÑÐºÐ¾Ð»ÑŒÐºÐ¸Ð¼Ð¸ ÑÑ‚Ð¾Ð»Ð±Ñ†Ð°Ð¼Ð¸, ÐµÑÐ»Ð¸ Ð´Ð¾Ð±Ð°Ð²Ð¸Ñ‚Ðµ ÑÐ²Ð¾Ð¹ÑÑ‚Ð²Ð¾ <code>grid-column-end</code>.</p><p>Ð˜ÑÐ¿Ð¾Ð»ÑŒÐ·ÑƒÑ <code>grid-column-end</code>, Ð¿Ð¾Ð»ÐµÐ¹Ñ‚Ðµ Ð²ÑÑŽ Ð¼Ð¾Ñ€ÐºÐ¾Ð²ÑŒ, Ð¸Ð·Ð±ÐµÐ³Ð°Ñ Ð¿ÑƒÑÑ‚Ñ‹Ðµ ÑƒÑ‡Ð°ÑÑ‚ÐºÐ¸. Ð’ÐµÐ´ÑŒ Ð¼Ñ‹ Ð½Ðµ Ñ…Ð¾Ñ‚Ð¸Ð¼ Ð¸ÑÐ¿Ð¾Ð»ÑŒÐ·Ð¾Ð²Ð°Ñ‚ÑŒ Ð²Ð¾Ð´Ñƒ Ð½Ð°Ð¿Ñ€Ð°ÑÐ½Ð¾! ÐŸÐ¾Ð¼Ð½Ð¸Ñ‚Ðµ, Ñ‡Ñ‚Ð¾ Ð¼Ð¾Ñ€ÐºÐ¾Ð²ÑŒ Ð½Ð°Ñ‡Ð¸Ð½Ð°ÐµÑ‚ÑÑ Ð½Ð° Ð¿ÐµÑ€Ð²Ð¾Ð¹ Ð²ÐµÑ€Ñ‚Ð¸ÐºÐ°Ð»ÑŒÐ½Ð¾Ð¹ grid-Ð»Ð¸Ð½Ð¸Ð¸ Ð¸ Ð·Ð°ÐºÐ°Ð½Ñ‡Ð¸Ð²Ð°ÐµÑ‚ÑÑ Ð½Ð° Ñ‡ÐµÑ‚Ð²Ñ‘Ñ€Ñ‚Ð¾Ð¹.</p>',
      'pl': '<p>Kiedy wÅ‚aÅ›ciwoÅ›Ä‡ <code>grid-column-start</code> jest uÅ¼yta pojedynczo, element domyÅ›lnie zajmie dokÅ‚adnie jednÄ… kolumnÄ™. JednakÅ¼e, moÅ¼esz rozszerzyÄ‡ element na wiele kolumn dodajÄ…c wÅ‚aÅ›ciwoÅ›Ä‡ <code>grid-column-end</code>.</p><p>UÅ¼ywajÄ…c <code>grid-column-end</code>, podlej tylko pola z marchewkami. Nie chcemy zmarnowaÄ‡ ani kropli wody! ZauwaÅ¼, Å¼e marchewki zaczynajÄ… siÄ™ od pierwszej pionowej linii i koÅ„czÄ… na czwartej.</p>',
