      'et': '<p>Kui <code>grid-column-start</code> on kasutatud Ã¼ksi, siis ruudustiku Ã¼ksus hÃµlmab vaikimisi tÃ¤pselt Ã¼hte veergu. Sa saad laiendada Ã¼ksust mitmele veerule, lisades <code>grid-column-end</code> omaduse.</p><p>Using <code>grid-column-end</code>, kasta kÃµik porgandid, vÃ¤ltides samal ajal mulda. Me ei taha vett raisata! Pane tÃ¤hele, et porgandid algavad esimese vertikaalse ruudustiku joonega ja lÃµpevad neljanda kohal.</p>',
