      'fi': '<p>On aika vaivalloista kirjoittaa aina sekÃ¤ <code>grid-column-start</code> ettÃ¤ <code>grid-column-end</code>. Onneksi on yhdistelmÃ¤ominaisuus <code>grid-column</code>, jolle voi mÃ¤Ã¤rittÃ¤Ã¤ molemmat arvot samalla kertaa vinoviivalla eroteltuna.</p><p>Esimerkiksi <code>grid-column: 2 / 4;</code> asettaa ruudukkoelementin aloituskohdan toiseen pystyviivaan ja lopetuskohdan neljÃ¤nteen.</p>',
      'hu': '<p>FÃ¡rasztÃ³ lehet folyton kiÃ­rni a <code>grid-column-start</code> Ã©s <code>grid-column-end</code> tulajdonsÃ¡gokat. SzerencsÃ©re a <code>grid-column</code> rÃ¶vidÃ­tett tulajdonsÃ¡g hasznÃ¡latÃ¡val a kÃ©t Ã©rtÃ©k egymÃ¡stÃ³l perjellel elvÃ¡lasztva egyszerre is megadhatÃ³.</p><p>PÃ©ldÃ¡ul a <code>grid-column: 2 / 4;</code> a rÃ¡cselem kezdetÃ©t a mÃ¡sodik, a vÃ©gÃ©t pedig a negyedik rÃ¡csvonalra Ã¡llÃ­tja be.</p>',
      'id': '<p>Mengetik kedua <code>grid-column-start</code> dan <code>grid-column-end</code> setiap saat bisa jadi sangat melelahkan. Untungnya, <code>grid-column</code> adalah properti singkatan yang dapat menerima kedua nilai sekaligus, dipisahkan dengan slash (garis miring).</p><p>Sebagai contoh, <code>grid-column: 2 / 4;</code> akan mengatur item grid untuk memulai pada garis grid vertikal ke-2 dan berakhir pada garis grid ke-4.</p>',
