      'it': '<p>Se gli elementi non sono esplicitamente posizionati con <code>grid-area</code>, <code>grid-column</code>, <code>grid-row</code>, ecc., sono automaticamente disposti secondo il loro ordine all\'interno del codice. Ãˆ possibile sovrascrivere questo ordine usando la proprietÃ  <code>order</code>, che Ã¨ anche un dei vantaggi di usare CSS grid invece che layout basati su tabelle.</p><p>Di default, ogni elemento della griglia ha <code>order</code> uguale a 0, ma puÃ² essere settato a qualsiasi valore, positivo o negativo, in modo analogo a <code>z-index</code>.</p><p>In questo caso, il diserbante (poison) sta venendo dato alle carote e invece le erbacce stanno venendo innaffiate. Cambia l\'<code>order</code> degli elementi per sistemare le cose il prima possibile!</p>',
