      'no': '<p>Hittil har du hatt en hage med et rutenett bestÃ¥ende av fem kolonner pÃ¥ 20% av hele bredden og fem rader pÃ¥ 20% av hele hÃ¸yden.</p><p>Dette ble definert med reglene <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> og <code>grid-template-rows: 20% 20% 20% 20% 20%;</code> Hver regel har fem verdier som lager fem kolonner pÃ¥ 20% av hele hagebredden.</p><p>Men du kan lage et rutenett akkurat som du vil. Gi <code>grid-template-columns</code> en ny verdi for Ã¥ vanne gulrÃ¸ttene dine. Den fÃ¸rste kolonnen bÃ¸r ha en bredde pÃ¥ 50%.',
      'pt-pt': '<p>AtÃ© este ponto, a tua horta estava definida como uma grelha com cinco colunas, cada uma com 20% da largura total, e cinco linhas, cada uma com 20% da altura total.</p><p>Tal foi estabelecido atravÃ©s das regras <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> e <code>grid-template-rows: 20% 20% 20% 20% 20%;</code>. Cada regra tem cinco valores que criam cinco colunas, cada uma com 20% da largura total da horta.</p><p>Mas podes definir a grelha como preferires. Atribui um novo valor a <code>grid-template-columns</code> para regar as tuas cenouras. DeverÃ¡s estabelecer a 1Âª coluna com uma largura de 50%.</p>',
      'bg': '<p>Ð”Ð¾ Ñ‚Ð¾Ð·Ð¸ Ð¼Ð¾Ð¼ÐµÐ½Ñ‚ Ð’Ð¸Ðµ Ð¸Ð¼Ð°Ñ…Ñ‚Ðµ Ð³Ñ€Ð°Ð´Ð¸Ð½Ð° Ñ€Ð°Ð·Ð¿Ð¾Ð»Ð¾Ð¶ÐµÐ½Ð° Ð² 5 ÐºÐ¾Ð»Ð¾Ð½Ð¸ Ð¾Ñ‚ CSS grid-Ð°, Ð²ÑÑÐºÐ° Ð¿Ð¾ 20% Ð¾Ñ‚ Ð¾Ð±Ñ‰Ð°Ñ‚Ð° ÑˆÐ¸Ñ€Ð¾Ñ‡Ð¸Ð½Ð° Ð¸ 5 Ñ€ÐµÐ´Ð°, Ð²ÑÐµÐºÐ¸ Ð¿Ð¾ 20% Ð¾Ñ‚ Ð¾Ð±Ñ‰Ð°Ñ‚Ð° Ð²Ð¸ÑÐ¾Ñ‡Ð¸Ð½Ð°.</p><p>Ð¢Ð¾Ð²Ð° Ð±ÐµÑˆÐµ Ñ‚Ð°ÐºÐ°, Ð·Ð°Ñ€Ð°Ð´Ð¸ ÑÐ²Ð¾Ð¹ÑÑ‚Ð²Ð°Ñ‚Ð° <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> Ð¸ <code>grid-template-rows: 20% 20% 20% 20% 20%;</code> Ð’ÑÑÐºÐ¾ ÑÐ²Ð¾Ð¹ÑÑ‚Ð²Ð¾ Ð¿Ñ€Ð¸Ñ‚ÐµÐ¶Ð°Ð²Ð° 5 ÑÑ‚Ð¾Ð¹Ð½Ð¾ÑÑ‚Ð¸, ÐºÐ¾Ð¸Ñ‚Ð¾ ÑÑŠÐ·Ð´Ð°Ð²Ð°Ñ‚ 5 ÐºÐ¾Ð»Ð¾Ð½Ð¸, Ð²ÑÑÐºÐ° Ð¾Ñ‚ Ð¿Ð¾ 20% Ð¾Ñ‚ Ð¾Ð±Ñ‰Ð°Ñ‚Ð° ÑˆÐ¸Ñ€Ð¾Ñ‡Ð¸Ð½Ð° Ð½Ð° Ð³Ñ€Ð°Ð´Ð¸Ð½Ð°Ñ‚Ð°.</p><p>Ð’Ð¸Ðµ Ð¼Ð¾Ð¶ÐµÑ‚Ðµ Ð´Ð° Ð¾Ð¿Ñ€ÐµÐ´ÐµÐ»Ð¸Ñ‚Ðµ ÐºÐ°Ðº Ð´Ð° Ð¸Ð·Ð³Ð»ÐµÐ¶Ð° Ð’Ð°ÑˆÐ¸ÑÑ‚ CSS grid. Ð—Ð°Ð´Ð°Ð¹Ñ‚Ðµ Ð½Ð¾Ð²Ð¸ ÑÑ‚Ð¾Ð¹Ð½Ð¾ÑÑ‚Ð¸ Ð½Ð° <code>grid-template-columns</code>, Ñ‚Ð°ÐºÐ° Ñ‡Ðµ Ð´Ð° Ð¿Ð¾ÐºÑ€Ð¸ÐµÑ‚Ðµ Ð¼Ð¾Ñ€ÐºÐ¾Ð²Ð¸Ñ‚Ðµ Ñ Ð²Ð¾Ð´Ð°. Ð—Ð°Ð´Ð°Ð¹Ñ‚Ðµ ÑˆÐ¸Ñ€Ð¾Ñ‡Ð¸Ð½Ð°Ñ‚Ð° Ð½Ð° Ð¿ÑŠÑ€Ð²Ð°Ñ‚Ð° ÐºÐ¾Ð»Ð¾Ð½Ð° Ð´Ð° Ð±ÑŠÐ´Ðµ 50% Ð¾Ñ‚ Ð¾Ð±Ñ‰Ð°Ñ‚Ð° ÑˆÐ¸Ñ€Ð¾Ñ‡Ð¸Ð½Ð°.</p>',
      'ca': '<p>Fins ara has tingut un jardÃ­ format per cinc columnes, cada una ocupant el 20% de l\'amplada total, i cinc files, cada una ocupant el 20% de l\'alÃ§ada total.</p><p>AixÃ² ha estat establert amb les propietats <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> i <code>grid-template-rows: 20% 20% 20% 20% 20%;</code>. Cada propietat tÃ© cinc valors que creen cinc columnes, cada una establerta al 20% de l\'amplada total del jardÃ­.</p><p>PerÃ² pots establir els valors en la quadrÃ­cula com vulguis. Dona a <code>grid-template-columns</code> un nou valor per regar les pastanagues. Voldras que l\'amplada de la primera columna sigui del 50%.</p>',
