      'fi': '<p>TÃ¤hÃ¤n asti puutarha on rakentunut viidestÃ¤ pystyrivistÃ¤, joista jokainen on 20 % ruudukon leveydestÃ¤, ja viidestÃ¤ vaakarivistÃ¤, joista jokainen on 20 % ruudukon korkeudesta.</p><p>TÃ¤mÃ¤ on saatu aikaan mÃ¤Ã¤rittÃ¤mÃ¤llÃ¤ <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> ja <code>grid-template-rows: 20% 20% 20% 20% 20%;</code>. Kummallakin mÃ¤Ã¤rityksellÃ¤ on viisi arvoa, joista syntyy viisi pysty- ja vaakariviÃ¤, joiden jokaisen koko on 20 % puutarhan koosta.</p><p>Voit kuitenkin mÃ¤Ã¤rittÃ¤Ã¤ ruudukon miten haluat. Kastele porkkanat mÃ¤Ã¤rittÃ¤mÃ¤llÃ¤ <code>grid-template-columns</code>-ominaisuudelle uusi arvo. EnsimmÃ¤isen pystyrivin leveyden tulee olla 50%.</p>',
      'hu': '<p>Eddig a kerted egy Ã¶t oszlopos Ã©s Ã¶t soros rÃ¡cskÃ©nt Ã¡llÃ­tottad be, rÃ¡csonkÃ©nt 20%-os szÃ©lessÃ©ggel Ã©s soronkÃ©nt 20%-os magassÃ¡ggal.</p><p>Ezt a <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> Ã©s <code>grid-template-rows: 20% 20% 20% 20% 20%;</code> szabÃ¡lyokkal Ã©rted el. Mindegyik szabÃ¡ly Ã¶t Ã©rtÃ©kkel rendelkezik, mellyel Ã¶t oszlopot Ã©s Ã¶t sort hoznak lÃ©tre.</p><p>Azonban a rÃ¡csot Ãºgy Ã¡llÃ­thatod be, ahogy csak akarod. A rÃ©pÃ¡k megÃ¶ntÃ¶zÃ©sÃ©hez adj a <code>grid-template-columns</code> tulajdonsÃ¡gnak Ãºj Ã©rtÃ©ket! Az elsÅ‘ oszlop Ã©rtÃ©kÃ©t 50%-ra akarod beÃ¡llÃ­tani.</p>',
      'id': '<p>Sampai saat ini, kamu telah menyiapkan taman sebagai grid dengan lima kolom, masing-masing 20% dari lebar penuh, dan lima baris, masing-masing 20% dari tinggi penuh.</p><p>Ini dilakukan dengan aturan <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> dan <code>grid-template-rows: 20% 20% 20% 20% 20%;</code> Setiap aturan memiliki lima nilai yang membuat lima kolom, masing-masing diatur ke 20% dari keseluruhan lebar taman.</p><p>Tetapi kamu dapat mengatur grid sesukamu. Berikan <code>grid-template-columns</code> nilai yang baru untuk menyiram wortelmu. Kamu ingin mengatur lebar kolom pertama menjadi 50%.</p>',
      'tl': '<p>Sa puntong \'to, naayos mo na \'yung hardin mo na may limang columns, tig-20% ng buong width, at limang rows, tig-20% ng the buong height.</p><p>Nagawa ito na may rules na <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> at <code>grid-template-rows: 20% 20% 20% 20% 20%;</code> Bawat rule ay may limang values na gumagawa ng limang columns, naka-set ng tig-20% na kabuuang width ng hardin.</p><p>Pero pwede mo naman i-set ang grid sa kagustuhan mo. Bigyan mo ng bagong value ang <code>grid-template-columns</code> para diligan ang mga karot. I-set mo ang width nung unang column ng 50%.</p>',
      'al': '<p>Deri nÃ« kÃ«tÃ« pike, juve e patÃ«t kopÃ«shtin tuaj si njÃ« grid me 5 kolona, secila 20% e gjithÃ« gjerÃ«sisÃ«, dhe 5 rrjeshta, secili 20% e gjithÃ« gjatÃ«sisÃ«.</p><p>Kjo u bÃ« me rregullat <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> dhe <code>grid-template-rows: 20% 20% 20% 20% 20%;</code> Secili rregull ka pesÃ« vlera tÃ« cilat krijojnÃ« pesÃ« kollona, secila 20% e gjithÃ« gjerÃ«sisÃ« sÃ« kopÃ«shtit.</p><p>Por juve mund ta vendosni grid sido qÃ« tÃ« dÃ«shironi. Jepini <code>grid-template-columns</code> njÃ« vlerÃ« tÃ« re pÃ«r tÃ« ujitur karotat. Ju duhet tÃ« vendosni gjerÃ«sinÃ« e kolonÃ«s sÃ« parÃ« 50%.</p>',
