      'hi': '<p><code>grid-template-columns</code> à¤¨ à¤•à¥‡à¤µà¤² à¤ªà¥à¤°à¤¤à¤¿à¤¶à¤¤ à¤®à¥‡à¤‚ à¤®à¤¾à¤¨ à¤¸à¥à¤µà¥€à¤•à¤¾à¤° à¤•à¤°à¤¤à¤¾ à¤¹à¥ˆ, à¤¬à¤²à¥à¤•à¤¿ à¤ªà¤¿à¤•à¥à¤¸à¥‡à¤² à¤”à¤° à¤ˆà¤à¤®à¤à¤¸ à¤œà¥ˆà¤¸à¥€ à¤²à¤‚à¤¬à¤¾à¤ˆ à¤•à¥€ à¤‡à¤•à¤¾à¤‡à¤¯à¥‹à¤‚ à¤•à¥‹ à¤­à¥€ à¤¸à¥à¤µà¥€à¤•à¤¾à¤° à¤•à¤°à¤¤à¤¾ à¤¹à¥ˆà¥¤ à¤†à¤ª à¤…à¤²à¤—-à¤…à¤²à¤— à¤‡à¤•à¤¾à¤‡à¤¯à¥‹à¤‚ à¤•à¥‹ à¤à¤• à¤¸à¤¾à¤¥ à¤®à¤¿à¤²à¤¾ à¤­à¥€ à¤¸à¤•à¤¤à¥‡ à¤¹à¥ˆà¤‚à¥¤</p><p>à¤¯à¤¹à¤¾à¤‚, à¤¤à¥€à¤¨ à¤•à¥‰à¤²à¤® à¤•à¥à¤°à¤®à¤¶à¤ƒ <code>100px</code>, <code>3em</code>, à¤”à¤° <code>40%</code> à¤ªà¤° à¤¸à¥‡à¤Ÿ à¤•à¤°à¥‡à¤‚à¥¤ .</p>',
      'lt': '<p>Nurodyti daug stulpeliÅ³ su identiÅ¡ku ploÄiu gali tapti nuobodu. Laimei yra <code>repeat</code> funkcija.</p><p>PavyzdÅ¾iui, anksÄiau mes nurodÄ—me penkis 20% ploÄio stulpelius su taisykle <code>grid-template-columns: 20% 20% 20% 20% 20%;</code>. Tai gali bÅ«ti supaprastinta kaip <code>grid-template-columns: repeat(5, 20%);</code></p><p>Naudodami <code>grid-template-columns</code> su <code>repeat</code> funkcija, sukurkite aÅ¡tuonis stulpelius, kiekvienas 12.5% ploÄio. Taip JÅ«s neuÅ¾tvindinsite sodo.</p>',
      'lv': '<p>RadÄ«t daudz kolonnas ar vienÄdiem platumiem ir diezgan nogurdinoÅ¡i un laikietilpÄ«gi. Par laimi mums ir pieejama <code>repeat</code> funkcija, kas to atvieglos.</p><p>PiemÄ“ram, iepriekÅ¡, definÄ“jot piecas 20% kolonnas, mÄ“s lietojÄm <code>grid-template-columns: 20% 20% 20% 20% 20%;</code>. Tas var tikt vienkÄrÅ¡ots ar  <code>grid-template-columns: repeat(5, 20%);</code></p><p>Lieto <code>grid-template-columns</code> kopÄ ar <code>repeat</code> funkciju un izveido astoÅ†as kolonnas, kur katra ir 12.5% plata. Å ÄdÄ veidÄ tu izvairÄ«sies no sava dÄrza pÄrlaistÄ«Å¡anas.</p>',
      'ro': '<p>SÄƒ specifici o grÄƒmadÄƒ de coloane cu lÄƒÈ›imi identice poate fi obositor. Din fericire existÄƒ funcÈ›ia <code>repeat</code> pentru a te ajuta.</p><p>De exemplu, noi am predefinit 5 coloane de 20% cu <code>grid-template-columns: 20% 20% 20% 20% 20%;</code>. Acest lucru poate fi simplificat cu <code>grid-template-columns: repeat(5, 20%);</code></p><p>Folosind <code>grid-template-columns</code> cu funcÈ›ia <code>repeat</code>, creazÄƒ 8 coloane, fiecare cu lÄƒÈ›imea de 12.5%. In acest fel nu vei inunda grÄƒdina.</p>',
