      'zh-tw': '<p>æŒ‡å®šä¸€äº›å…·æœ‰ç›¸åŒå¯¬åº¦çš„ç¶²æ ¼é …æœƒè®Šå¾—å¾ˆä¹å‘³ã€‚å¹¸é‹åœ°æ˜¯æœ‰ <code>repeat</code> å‡½æ•¸ä¾†å¹«åŠ©æˆ‘å€‘ã€‚</p><p>æ¯”å¦‚èªªï¼Œä¹‹å‰æˆ‘å€‘ä½¿ç”¨ <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> å±¬æ€§å®šç¾©äº† 5 è¡Œï¼Œæ¯è¡Œä½” 20%ã€‚é€™å¯ä»¥è¢«ç°¡å¯«ç‚ºï¼š<code>grid-template-columns: repeat(5, 20%);</code></p><p>ä½¿ç”¨ <code>grid-template-columns</code> å±¬æ€§ä»¥åŠ <code>repeat</code> å‡½æ•¸ï¼Œå‰µå»º 8 è¡Œï¼Œæ¯è¡Œä½” 12.5% çš„å¯¬åº¦ã€‚é€™æ¨£ä½ å°±ä¸æœƒçµ¦èŠ±åœ’æ¾†éŽå¤šçš„æ°´ã€‚</p>',
      'tr': '<p>AynÄ± geniÅŸlikte bir grup kolon belirtmek sÄ±kÄ±ntÄ±ya neden olabilir.</p><p>Neyse ki <code>repeat</code> fonksiyonu bu tarz durumlarda yardÄ±m iÃ§in var.</p><p>Ã–rneÄŸin; daha Ã¶nce <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> kuralÄ± ile beÅŸ adet %20\'lik kolon tanÄ±mlamÄ±ÅŸtÄ±k. Bu ÅŸu ÅŸekilde kÄ±saltÄ±labilir: <code>grid-template-columns: repeat(5, 20%);</code></p><p><code>grid-template-columns</code> ile <code>repeat</code> iÅŸlevini kullanarak, her biri % 12.5 geniÅŸliÄŸe sahip sekiz kolon oluÅŸturun. Bu ÅŸekilde bahÃ§eniz su altÄ±nda kalmayacaktÄ±r.</p> ',
      'az': '<p>Eyni geniÅŸlikdÉ™ bir qrup sÃ¼tun mÃ¼É™yyÉ™n etmÉ™k problemÉ™ sÉ™bÉ™b olabilÉ™r.</p><p>XoÅŸbÉ™xtlikdÉ™n <code>repeat</code> funksiyasÄ± belÉ™ hallar Ã¼Ã§Ã¼n var.</p><p>NÃ¼munÉ™; daha Ã¶ncÉ™ <code>grid-template-columns: 20% 20% 20% 20% 20%;</code> qaydasÄ± ilÉ™ beÅŸ É™dÉ™d %20\'lik sÃ¼tun tÉ™yin etmiÅŸdik. Bu belÉ™ formada qÄ±saldÄ±la bilÉ™r: <code>grid-template-columns: repeat(5, 20%);</code></p><p><code>grid-template-columns</code> ilÉ™ <code>repeat</code> istifadÉ™ edÉ™rÉ™k, hÉ™r biri % 12.5 geniÅŸliyinÉ™ sahib sÉ™kkiz sÃ¼tun tÉ™yin edin. Bu ÅŸÉ™kildÉ™ baÄŸÃ§anÄ±z su altÄ±nda qalmayacaq.</p> ',
      'fr': '<p>Le fait de spÃ©cifier un ensemble de colonnes avec des largeurs identiques peut devenir fastidieux. Heureusement, il y a une fonction <code>repeat</code> pour nous aider.</p><p>Par exemple, nous avons dÃ©fini prÃ©cÃ©demment cinq colonnes de 20% avec la rÃ¨gle <code>grid-template-columns: 20% 20% 20% 20% 20%;</code>. Ceci peut Ãªtre simplifiÃ© ainsi <code>grid-template-columns: repeat(5, 20%);</code></p><p>A l\'aide de <code>grid-template-columns</code> avec la fonction <code>repeat</code>, crÃ©ez huit colonnes avec chacune une largeur de 12.5%. De cette faÃ§on, vous ne sur-arrosez pas votre jardin.</p>',
      'de': '<p>Mehrere Spalten mit identischen Breiten anzugeben kann mÃ¼hsam werden. Zum GlÃ¼ck gibt es eine <code>repeat</code> Funktion, die uns hilft.</p><p>Zum Beispiel haben wir vorher fÃ¼nf Spalten mit 20% definiert mit der Regel <code>grid-template-columns: 20% 20% 20% 20% 20%;</code>. Dies kann vereinfacht werden zu <code>grid-template-columns: repeat(5, 20%);</code></p><p>Benutze <code>grid-template-columns</code> mit der <code>repeat</code> Funktion um acht Spalten von je 12.5% Breite zu erstellen. So wirst du deinen Garten nicht Ã¼berwÃ¤ssern.</p>',
      'nl': '<p>Het opgeven van een stel kolommen met identieke breedtes kan vervelend worden. Gelukkig is er een <code>repeat</code>-functie om daarmee te helpen.</p><p>We hebben bijvoorbeeld eerder vijf 20 %-kolommen gedefinieerd met de regel <code>grid-template-columns: 20% 20% 20% 20% 20%;</code>. Dat kan vereenvoudigd worden naar <code>grid-template-columns: repeat(5, 20%);</code></p><p>Gebruik <code>grid-template-columns</code> met de <code>repeat</code>-functie, maak acht kolommen met ieder een breedte van 12.5 %. Op deze manier zal je tuin niet te veel water krijgen.</p>',
