      'ps': '<p>Ø¯ ÙˆØ±ØªÙ‡ Ø¹Ø±Ø¶ÙˆÙ†Ùˆ Ø³Ø±Ù‡ Ø¯ Ú«Ú¼ Ø´Ù…ÛØ± Ú©Ø§Ù„Ù…ÙˆÙ†Ùˆ Ù…Ø´Ø®Øµ Ú©ÙˆÙ„ Ú«Ø±Ø§Ù† Ú©ÛŒØ¯ÛŒ Ø´ÙŠ. Ø®ÙˆØ´Ø¨Ø®ØªØ§Ù†Ù‡ØŒ ÛŒÙˆ <code>repeat</code> ÙÙ†Ú©Ø´Ù† Ø´ØªÙ‡ Ú†Û Ø¯Û Ø³Ø±Ù‡ Ù…Ø±Ø³ØªÙ‡ Ú©ÙˆÙŠ.</p><p>Ù…Ø«Ù„Ø§Ù‹ØŒ Ù…ÙˆÚ– Ù…Ø®Ú©Û Ø¯ Ù„Ø§Ù†Ø¯Û Ù‚Ø§Ø¹Ø¯Û Ø³Ø±Ù‡ Ù¾Ù†ÚÙ‡ 20% Ú©Ø§Ù„Ù…ÙˆÙ†Ù‡ ØªØ¹Ø±ÛŒÙ Ú©Ú“Ù„: <code>grid-template-columns: 20% 20% 20% 20% 20%;</code>. Ø¯Ø§ Ø¯ <code>grid-template-columns: repeat(5, 20%);</code> Ù¾Ù‡ ØªÙˆÚ«Ù‡ Ø³Ø§Ø¯Ù‡ Ú©ÛŒØ¯ÛŒ Ø´ÙŠ.</p><p>Ø¯ <code>grid-template-columns</code> Ø³Ø±Ù‡ Ø¯ <code>repeat</code> ÙÙ†Ú©Ø´Ù† Ú©Ø§Ø±ÙˆÙ„Ùˆ Ø³Ø±Ù‡ØŒ Ø§ØªÙ‡ Ú©Ø§Ù„Ù…ÙˆÙ†Ù‡ Ø¬ÙˆÚ“ Ú©Ú“Ø¦ Ú†Û Ù‡Ø± ÛŒÙˆ ÛŒÛ 12.5% Ø¹Ø±Ø¶ ÙˆÙ„Ø±ÙŠ. Ø¯Ø§ Ø·Ø±ÛŒÙ‚Ù‡ Ø¨Ù‡ Ø¯ Ø¨Ø§Øº Ø§ÙˆØ¨Ù‡ Ú‰ÛŒØ±Û Ù†Ù‡ Ú©Ú“ÙŠ.</p>',
