      'tr': '<p>Grid ayrÄ±ca kesirli, yeni bir birim getiriyor: <code>fr</code>. Her <code>fr</code> birimi, kullanÄ±labilir alanÄ±n bir payÄ±nÄ± tahsis eder. Ã–rneÄŸin, iki Ã¶ÄŸe sÄ±rasÄ±yla <code>1fr</code> ve <code>3fr</code> olarak ayarlandÄ±ysa, alan dÃ¶rt eÅŸit paydaya bÃ¶lÃ¼nÃ¼r; ilk eleman 1/4 ve ikinci eleman kalan boÅŸluÄŸun 3/4\'Ã¼nÃ¼ kaplar.</p><p>Burada yabani otlar, ilk sÄ±ranÄ±n 1/6\'sÄ±nÄ±, diÄŸer 5/6 alanÄ± ise havuÃ§lar oluÅŸturuyor. <code>fr</code> birimlerini kullanarak bu geniÅŸliklere sahip iki sÃ¼tun oluÅŸturun.</p>',
      'az': '<p>Grid É™lavÉ™ olaraq, yeni bir Ã¶lÃ§Ã¼ vahidi gÉ™tirir: <code>fr</code>. HÉ™r <code>fr</code> Ã¶lÃ§Ã¼ vahidi, istifadÉ™ edilÉ™ bilÉ™n sahÉ™nin bir hissÉ™sini tÉ™yin edir. MÉ™sÉ™lÉ™n, iki element sÄ±ra ilÉ™ <code>1fr</code> vÉ™ <code>3fr</code> olaraq tÉ™yin edildisÉ™, sahÉ™ dÃ¶rd bÉ™rabÉ™r hissÉ™yÉ™ bÃ¶lÃ¼nÃ¼r; Ä°lk element 1/4 vÉ™ ikinci element geridÉ™ qalan boÅŸluÄŸun 3/4\'Ã¼nÃ¼ É™hatÉ™ edÉ™r.</p><p>Burada yabani otlar, ilk sÄ±ranÄ±n 1/6\'sÄ±nÄ±, digÉ™r 5/6 sahÉ™ni isÉ™ kÃ¶klÉ™r É™hatÉ™ edir. <code>fr</code> Ã¶lÃ§Ã¼ vahidlÉ™rini istifadÉ™ edÉ™rÉ™k bu geniÅŸliklÉ™rÉ™ sahib iki sÃ¼tun yaradÄ±n.</p>',
      'fr': '<p>La grille introduit Ã©galement une nouvelle unitÃ©, le fractionnaire <code>fr</code>. Chaque unitÃ©  <code>fr</code> alloue une partie de l\'espace disponible. Par exemple, si deux Ã©lÃ©ments sont dÃ©finies respectivement avec <code>1fr</code> et <code>3fr</code>,  l\'espace est divisÃ© en 4 parts Ã©gales, le premier Ã©lÃ©ment occupant 1/4 et le deuxiÃ¨me Ã©lÃ©ment 3/4 de l\'espace disponible.</p><p>Ici, les mauvaises herbes reprÃ©sentent 1/6 de votre premiÃ¨re ligne et les carottes les 5/6 restants. CrÃ©ez deux colonnes avec ces largeurs en utilisant les unitÃ©s <code>fr</code>.</p>',
      'de': '<p>Grid fÃ¼hrt auch eine neue Einheit ein, den Bruchteil ("fractional") <code>fr</code>. Jede <code>fr</code> Einheit weist einen Anteil des verfÃ¼gbaren Platzes zu. Wenn zum Beispiel zwei Elemente auf <code>1fr</code> und <code>3fr</code> gesetzt sind, wird der verfÃ¼gbare Platz in vier gleich grosse Teile aufgeteilt; das erste Element besetzt 1/4 und das zweite Element 3/4 des restlichen Platzes.</p><p>Hier machen Unkraut 1/6 deiner ersten Reihe aus und Karotten die Ã¼brigen 5/6. Erstelle zwei Spalten mit diesen Breiten unter Verwendung von <code>fr</code> Einheiten.</p>',
      'nl': '<p>Grid introduceert ook een nieuwe eenheid, de fractie <code>fr</code>. Iedere <code>fr</code>-eenheid kent Ã©Ã©n deel van de beschikbare ruimte toe. Bijvoorbeeld wanneer twee elementen respectievelijk <code>1fr</code> en <code>3fr</code> zijn, wordt de ruimte ingedeeld in 4 gelijke delen; het eerste element bezet 1/4 en het tweede element 3/4 van de overgebleven ruimte.</p><p>Hier vormen onkruid de linker 1/6 van je eerste rij en wortels de overige 5/6. Maak twee kolommen met deze breedtes door <code>fr</code>-eenheden te gebruiken.</p>',
      'pt-br': '<p>CSS Grid tambÃ©m introduz uma nova medida, a fracionÃ¡rio <code>fr</code>. Cada medida <code>fr</code> aloca um pedaÃ§o do espaÃ§o disponÃ­vel. Por exemplo, se dois elementos estÃ£o definidos para <code>1fr</code> e <code>3fr</code> respectivamente, o espaÃ§o Ã© dividido em 4 partes iguais; o primeiro elemento ocupa 1/4 e o segundo elemento 3/4 do espaÃ§o restante.</p><p>Aqui, ervas daninhas ocupam 1/6 da sua primeira linha e as cenouras os 5/6 restantes. Crie duas colunas com essas larguras usando a unidade <code>fr</code>.</p>',
      'ru': '<p>CSS Grid Layout Ñ‚Ð°ÐºÐ¶Ðµ Ð²Ð²Ð¾Ð´Ð¸Ñ‚ Ð½Ð¾Ð²ÑƒÑŽ ÐµÐ´Ð¸Ð½Ð¸Ñ†Ñƒ Ð¸Ð·Ð¼ÐµÑ€ÐµÐ½Ð¸Ñ: Ð´Ñ€Ð¾Ð±Ð½Ñ‹Ð¹ <code>fr</code> (Ð°Ð½Ð³Ð». <em>fraction</em>). ÐšÐ°Ð¶Ð´Ñ‹Ð¹ <code>fr</code> Ð²Ñ‹Ð´ÐµÐ»ÑÐµÑ‚ Ð¾Ð´Ð½Ñƒ Ñ‡Ð°ÑÑ‚ÑŒ ÑÐ²Ð¾Ð±Ð¾Ð´Ð½Ð¾Ð³Ð¾ Ð¿Ñ€Ð¾ÑÑ‚Ñ€Ð°Ð½ÑÑ‚Ð²Ð°. ÐÐ°Ð¿Ñ€Ð¸Ð¼ÐµÑ€, ÐµÑÐ»Ð¸ Ð´Ð²ÑƒÐ¼ ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚Ð°Ð¼ Ð·Ð°Ð´Ð°Ð½Ð¾ <code>1fr</code> Ð¸ <code>3fr</code> ÑÐ¾Ð¾Ñ‚Ð²ÐµÑ‚ÑÑ‚Ð²ÐµÐ½Ð½Ð¾, Ñ‚Ð¾ Ð¿Ñ€Ð¾ÑÑ‚Ñ€Ð°Ð½ÑÑ‚Ð²Ð¾ Ð±ÑƒÐ´ÐµÑ‚ Ð¿Ð¾Ð´ÐµÐ»ÐµÐ½Ð¾ Ð½Ð° 4 Ð¾Ð´Ð¸Ð½Ð°ÐºÐ¾Ð²Ñ‹Ðµ Ñ‡Ð°ÑÑ‚Ð¸. ÐŸÐµÑ€Ð²Ñ‹Ð¹ ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚ Ð·Ð°Ð¹Ð¼ÐµÑ‚ Â¼, Ð° Ð²Ñ‚Ð¾Ñ€Ð¾Ð¹ Ð¾ÑÑ‚Ð°Ð²ÑˆÐ¸ÐµÑÑ Â¾ Ð¿Ñ€Ð¾ÑÑ‚Ñ€Ð°Ð½ÑÑ‚Ð²Ð°.</p><p>Ð¡ÐµÐ¹Ñ‡Ð°Ñ ÑÐ¾Ñ€Ð½ÑÐºÐ¸ Ð·Ð°Ð½Ð¸Ð¼Ð°ÑŽÑ‚ Ð»ÐµÐ²ÑƒÑŽ â…™ Ñ‡Ð°ÑÑ‚ÑŒ Ð²Ð°ÑˆÐµÐ¹ Ð¿ÐµÑ€Ð²Ð¾Ð¹ ÑÑ‚Ñ€Ð¾ÐºÐ¸, Ð° Ð¼Ð¾Ñ€ÐºÐ¾Ð²ÑŒ Ð¾ÑÑ‚Ð°Ð²ÑˆÐ¸ÐµÑÑ â…š. Ð¡Ð¾Ð·Ð´Ð°Ð¹Ñ‚Ðµ Ð´Ð²Ð° ÑÑ‚Ð¾Ð»Ð±Ñ†Ð° Ñ Ñ‚Ð°ÐºÐ¾Ð¹ Ð¶Ðµ ÑˆÐ¸Ñ€Ð¸Ð½Ð¾Ð¹, Ð¸ÑÐ¿Ð¾Ð»ÑŒÐ·ÑƒÑ <code>fr</code>.</p>',
      'pl': '<p>Grid takÅ¼e wprowadza nowÄ… jednostkÄ™, uÅ‚amek <code>fr</code>. KaÅ¼da jednostka <code>fr</code> przyporzÄ…dkowuje jednÄ… czÄ™Å›Ä‡ wolnej przestrzeni . Na przykÅ‚ad, jeÅ¼eli dwa elementy majÄ… wartoÅ›ci odpowiednio <code>1fr</code> i <code>3fr</code>, przestrzeÅ„ jest podzielona na 4 rÃ³wne czÄ™Å›ci; pierwszy element zajmuje 1/4, a drugi element 3/4 pozostaÅ‚ej przestrzeni.</p><p>Tutaj, chwasty tworzÄ… 1/6 twojego pierwszego wiersza, a marchewki pozostaÅ‚e 5/6. StwÃ³rz dwie kolumny z tymi dÅ‚ugoÅ›ciami uÅ¼ywajÄ…c jednostek <code>fr</code>.</p>',
      'es': '<p>CSS Grid tambiÃ©n introduce una nueva medida, la fracciÃ³n <code>fr</code>. Cada unidad <code>fr</code> asigna una porciÃ³n del espacio disponible. Por ejemplo, si dos elementos estÃ¡n establecidos a <code>1fr</code> y <code>3fr</code> respectivamente el espacio se divide en 4 porciones iguales; el primer elemento ocupa 1/4 del espacio y el segundo elemento los 3/4 restantes.</p><p>Ahora las malas hierbas ocupan 1/6 de tu primera fila y las zanahorias los restantes 5/6. Crea dos columnas con ese ancho empleando <code>fr</code>.</p>',
