      'it': '<p>CSS Grid aggiunge una nuova unitÃ  di misura, la frazione <code>fr</code>. Ogni <code>fr</code> definisce una frazione dello spazio disponibile. Per esempio, se due elementi sono impostati rispettivamente a <code>1fr</code> e <code>3fr</code>, lo spazione Ã¨ diviso in 4 parti uguali; il primo elemento occuperÃ  1/4 e il secondo elemento 3/4 di tutto lo spazio avanzato.</p><p>Qui, le erbacce occupano 1/6 dello spazio della prima riga e le carote il restante 5/6. Crea due colonne con queste dimensioni usando <code>fr</code>.</p>',
