      'ua': '<p>Grid Ñ‚Ð°ÐºÐ¾Ð¶ Ð²Ð²Ð¾Ð´Ð¸Ñ‚ÑŒ Ð½Ð¾Ð²Ñƒ Ð¾Ð´Ð¸Ð½Ð¸Ñ†ÑŽ Ð²Ð¸Ð¼Ñ–Ñ€Ñƒ, Ð´Ñ€Ð¾Ð±Ð¾Ð²Ð¸Ð¹ <code>fr</code>. ÐšÐ¾Ð¶ÐµÐ½ <code>fr</code> Ð²Ð¸Ð´Ñ–Ð»ÑÑ” Ð¾Ð´Ð½Ñƒ Ñ‡Ð°ÑÑ‚Ð¸Ð½Ñƒ Ð²Ñ–Ð»ÑŒÐ½Ð¾Ð³Ð¾ Ð¿Ñ€Ð¾ÑÑ‚Ð¾Ñ€Ñƒ. ÐÐ°Ð¿Ñ€Ð¸ÐºÐ»Ð°Ð´, ÑÐºÑ‰Ð¾ Ð´Ð²Ð° ÐµÐ»ÐµÐ¼ÐµÐ½Ñ‚Ð¸ Ð¼Ð°ÑŽÑ‚ÑŒ Ð²Ð»Ð°ÑÑ‚Ð¸Ð²Ñ–ÑÑ‚ÑŒ Ñ€Ñ–Ð²Ð½Ñƒ <code>1fr</code> Ñ– <code>3fr</code> Ð²Ñ–Ð´Ð¿Ð¾Ð²Ñ–Ð´Ð½Ð¾, Ñ‚Ð¾ Ñ‚Ð¾Ð´Ñ– Ð¿Ñ€Ð¾ÑÑ‚Ñ–Ñ€ Ð±ÑƒÐ´Ðµ Ð¿Ð¾Ð´Ñ–Ð»ÐµÐ½Ð¾ Ð½Ð° 4 Ð¾Ð´Ð½Ð°ÐºÐ¾Ð²Ñ– Ñ‡Ð°ÑÑ‚Ð¸Ð½Ð¸. ÐŸÐµÑ€ÑˆÐ¸Ð¹ ÐµÐ»ÐµÐ¼ÐµÐ½Ñ‚ Ð·Ð°Ð¹Ð¼Ðµ 1/4 Ð° Ð´Ñ€ÑƒÐ³Ð¸Ð¹ 3/4 Ð²ÑÑŒÐ¾Ð³Ð¾ Ð¿Ñ€Ð¾ÑÑ‚Ð¾Ñ€Ñƒ, Ñ‰Ð¾ Ð·Ð°Ð»Ð¸ÑˆÐ¸Ð»Ð¾ÑÑ.</p><p>Ð—Ð°Ñ€Ð°Ð· Ð±ÑƒÑ€\'ÑÐ½Ð¸ Ð·Ð°Ð¹Ð¼Ð°ÑŽÑ‚ÑŒ Ð»Ñ–Ð²Ñƒ 1/6 Ñ‡Ð°ÑÑ‚Ð¸Ð½Ñƒ Ð²Ð°ÑˆÐ¾Ð³Ð¾ Ð¿ÐµÑ€ÑˆÐ¾Ð³Ð¾ Ñ€ÑÐ´ÐºÐ°, Ð° Ð¼Ð¾Ñ€ÐºÐ²Ñ– Ð·Ð°Ð»Ð¸ÑˆÐ¸Ð»Ð¸ÑÑ 5/6. Ð¡Ñ‚Ð²Ð¾Ñ€Ñ–Ñ‚ÑŒ Ð´Ð²Ð° ÑÑ‚Ð¾Ð²Ð¿Ñ†Ñ– Ð· Ñ‚Ð°ÐºÐ¸Ð¼Ð¸ Ð¶ ÑˆÐ¸Ñ€Ð¾Ñ‚Ð°Ð¼Ð¸, Ð²Ð¸ÐºÐ¾Ñ€Ð¸ÑÑ‚Ð¾Ð²ÑƒÑŽÑ‡Ð¸ Ð¾Ð´Ð¸Ð½Ð¸Ñ†Ñ– <code>fr</code>.</p>',
      'no': '<p>CSS grid introduserer ogsÃ¥ en ny enhet, <code>fr</code>, som stÃ¥r for en brÃ¸kdel av den tilgjengelige bredden. For eksempel, hvis to elementer har verdier pÃ¥ <code>1fr</code> og <code>3fr</code> hver, deles plassen opp i fire like deler; det fÃ¸rste elementet tar opp 1/4 av plassen og det andre elementet 3/4 av plassen som er igjen.</p><p>NÃ¥ tar ugresset opp 1/6 av plassen pÃ¥ den fÃ¸rste raden og gulrÃ¸ttene 5/6 av det som er igjen. Lag to kolonner med disse breddene ved Ã¥ bruke <code>fr</code>-enheten.</p>',
