      'ar': '<p>Ø§Ù„Ø¬Ø±ÙŠØ¯ Ù‚Ø¯Ù…Øª Ø§ÙŠØ¶Ø§ ÙˆØ­Ø¯Ø© Ø¬Ø¯ÙŠØ¯Ø©, ÙˆÙ‡ÙŠ<code>fr</code>. ÙƒÙ„ ÙˆØ­Ø¯Ø©&nbsp;<code>fr</code> ØªØ®ØµØµ Ø­ØµØ© ÙˆØ§Ø­Ø¯Ø© Ù…Ù† Ø§Ù„Ù…Ø³Ø§Ø­Ø© Ø§Ù„Ù…ØªØ§Ø­Ø©. Ø¹Ù„Ù‰ Ø³Ø¨ÙŠÙ„ Ø§Ù„Ù…Ø«Ø§Ù„, Ø§Ø°Ø§ ØªÙ… ØªØ¹ÙŠÙŠÙ† Ø¹Ù†ØµØ±ÙŠÙ† Ø¹Ù„Ù‰&nbsp;<code>1fr</code> Ùˆ&nbsp;<code>3fr</code> Ø¹Ù„Ù‰ Ø§Ù„ØªÙˆØ§Ù„ÙŠ, ÙØ³ÙŠØªÙ… ØªÙ‚Ø³ÙŠÙ… Ø§Ù„Ù…Ø³Ø§Ø­Ø© Ø§Ù„Ù‰ Ø§Ø±Ø¨Ø¹ Ø­ØµØµ Ù…ØªØ³Ø§ÙˆÙŠØ©; ÙŠØ´ØºÙ„ Ø§Ù„Ø¹Ù†ØµØ± Ø§Ù„Ø§ÙˆÙ„ 1/4 ÙˆØ§Ù„Ø¹Ù†ØµØ± Ø§Ù„Ø«Ø§Ù†ÙŠ 3/4 Ù…Ù† Ø§ÙŠ Ù…Ø³Ø§Ø­Ø© Ù…ØªØ¨Ù‚ÙŠØ©,&nbsp;</p><p>Ù‡Ù†Ø§, ØªØ´ÙƒÙ„ Ø§Ù„Ø­Ø´Ø§Ø¦Ø´ 1/6 Ø§Ù„Ù…ØªØ¨Ù‚ÙŠØ© Ù…Ù† Ø§Ù„ØµÙ Ø§Ù„Ø§ÙˆÙ„ Ùˆ Ø§Ù„Ø¬Ø²Ø± ÙŠØ´ÙƒÙ„ Ø§Ù„ 5/6 Ø§Ù„Ù…ØªØ¨Ù‚ÙŠØ©. Ø£Ù†Ø´Ø¦ Ø¹Ù…ÙˆØ¯ÙŠÙ† Ù‡Ø°Ù‡ Ø§Ù„Ø¹Ø±ÙˆØ¶ Ø¨Ø§Ø³ØªØ®Ø¯Ø§Ù… ÙˆØ­Ø¯Ø§Øª <code>fr</code>.</p>',
      'fi': '<p>Grid-asettelun mukana tulee myÃ¶s uusi yksikkÃ¶ <code>fr</code>, joka jakaa jÃ¤ljellÃ¤ olevan tilan murto-osiin. Jos esimerkiksi yhdelle elementille on mÃ¤Ã¤ritetty arvo <code>1fr</code> ja toiselle <code>3fr</code>, jÃ¤ljellÃ¤ oleva tila jaetaan neljÃ¤Ã¤n yhtÃ¤ suureen osaan, ja ensimmÃ¤inen elementti vie 1/4 ja toinen 3/4 tuosta tilasta.</p><p>TÃ¤ssÃ¤ rikkaruohot ovat vallanneet ensimmÃ¤isen rivin vasemman reunan 1/6:n leveydeltÃ¤ ja porkkanat peittÃ¤vÃ¤t loput 5/6. Luo kaksi pystyriviÃ¤ nÃ¤iden leveyksien perusteella mÃ¤Ã¤rittÃ¤mÃ¤llÃ¤ <code>fr</code>-yksikÃ¶t.</p>',
      'hu': '<p>A rÃ¡ccsal egy Ãºj mÃ©rtÃ©kegysÃ©g is bevezetÃ©sre kerÃ¼lt, a rÃ©szegysÃ©g <code>fr</code> (fraction). Minden <code>fr</code> egysÃ©g a rendelkezÃ©sre Ã¡llÃ³ hely egy rÃ©szÃ©t foglalja le. PÃ©ldÃ¡ul kÃ©t, <code>1fr</code> Ã©s <code>3fr</code>  mÃ©retÅ±re Ã¡llÃ­tott elem esetÃ©n a rendelkezÃ©sre Ã¡llÃ³ hely nÃ©gy egyforma rÃ©szre lesz osztva, ahol az elsÅ‘ elem 1/4, a mÃ¡sodik elem pedig 3/4 rÃ©szre terjed ki.</p><p>Itt a gyom az elsÅ‘ sorod bal oldali 1/6 rÃ©szÃ©t, a rÃ©pa pedig a maradÃ©k 5/6 rÃ©szÃ©t teszi ki. KÃ©szÃ­ts az <code>fr</code> egysÃ©g segÃ­tsÃ©gÃ©vel kÃ©t ilyen oszlopot!</p>',
      'id': '<p>Grid juga memperkenalkan unit baru, pecahan <code>fr</code>. Setiap unit <code>fr</code> mengalokasikan satu bagian dari ruang yang tersedia. Sebagai contoh, jika dua elemen diatur ke <code>1fr</code> dan <code>3fr</code> masing-masing, ruang dibagi menjadi 4 bagian yang sama; elemen pertama menempati 1/4 dan elemen kedua 3/4 dari sisa ruang.</p><p>Di sini, rumput liar terdiri dari 1/6 kiri dari baris pertama kamu dan wortel 5/6 sisanya. Buat dua kolom dengan lebar ini menggunakan satuan <code>fr</code>.</p>',
      'tl': '<p>Nag-introduce din ang Grid ng bagong unit na fractional <code>fr</code>. Bawat <code>fr</code> unit ay naglalaan ng isang bahagi ng available na space. Halimbawa, kung ang dalawang elements ay naka-set sa <code>1fr</code> at <code>3fr</code> nang magkasunod, mahahati sa apat na magkakapantay-pantay na bahagi ang space;\'yung unang element ay sasakupin ang 1/4 at ang ikalawang element ay 3/4 ng anumang natitirang space.</p><p>Dito, nasasakop ng mga damo \'yung kaliwang 1/6 ng unang mong row at ang natitirang 5/6 naman sa mga karot. Gumawa ka ng dalawang columns na may ganitong widths gamit ang <code>fr</code> units.</p>',
      'al': '<p>Grid gjithashtu prezanton njÃ« cilÃ«si tÃ« re, fraksionin <code>fr</code>. Secila <code>fr</code> cilÃ«si do tÃ« zÃ«rÃ« njÃ« shpÃ«rndarje tÃ« hapÃ«sirÃ«s sÃ« dhÃ«ne. PÃ«r shembull, nÃ«se dy elementÃ« janÃ« vendosur si <code>1fr</code> dhe <code>3fr</code> respektivisht, hapÃ«sira do tÃ« ndahet nÃ« katÃ«r pjesÃ« tÃ« barabarta; elementi i parÃ« do tÃ« zÃ«rÃ« 1/4 dhe elementi i dytÃ« 3/4 e gjithÃ« pjesÃ«s sÃ« ngelur.</p><p>KÃ«tu, shkurret zÃ«nÃ« tÃ« majtÃ«n e 1/6 e rrjeshtit tuaj tÃ« parÃ« dhe karotat pjesÃ«n e ngelur 5/6. Krijoni dy kolona me kÃ«to gjerÃ«si duke pÃ«rdorur <code>fr</code> units.</p>',
      'et': '<p>Grid tutvustab ka uue Ã¼hiku, murdosa<code>fr</code>. Iga <code>fr</code> Ã¼hik mÃ¤Ã¤rab Ã¼he osa kogu vabast alast. NÃ¤iteks kui kaks elementi on seatud vÃ¤Ã¤rtusele <code>1fr</code> ja <code>3fr</code>, ruum on jagatud 4 vÃµrdseks osaks; esimene element hÃµivab 1/4 ja teine element 3/4 Ã¼lejÃ¤Ã¤nud ruumist.</p><p>Siin moodustavad umbrohud 1/6 teie esimesest reast ja porgandid Ã¼lejÃ¤Ã¤nud 5/6. Looge nende laiustega kaks veergu kasutades<code>fr</code> Ã¼hikuid.</p>',
