      'ps': '<p>Ø¯ Ú«Ø±ÛŒØ¯ ÛŒÙˆ Ù†ÙˆÛŒ ÙˆØ§Ø­Ø¯ Ù‡Ù… Ù…Ø¹Ø±ÙÙŠ Ú©ÙˆÙŠØŒ Ø¯ fractional <code>fr</code>. Ù‡Ø± <code>fr</code> ÙˆØ§Ø­Ø¯ ÛŒÙˆ Ø¨Ø±Ø®Ù‡ Ø¯ Ù…ÙˆØ¬ÙˆØ¯ ÚØ§ÛŒ ØªØ®ØµÛŒØµ Ú©ÙˆÙŠ. Ø¯ Ø¨ÛÙ„Ú«Û Ù¾Ù‡ ØªÙˆÚ«Ù‡ØŒ Ú©Ù‡ Ø¯ÙˆÙ‡ Ø¹Ù†Ø§ØµØ± Ù¾Ù‡ ØªØ±ØªÛŒØ¨ Ø³Ø±Ù‡ <code>1fr</code> Ø§Ùˆ <code>3fr</code> ØªÙ‡ Ù¼Ø§Ú©Ù„ Ø´ÙˆÙŠ ÙˆÙŠØŒ ÚØ§ÛŒ Ù¾Ù‡ Û´ Ù…Ø³Ø§ÙˆÙŠ Ø¨Ø±Ø®Ùˆ ÙˆÛŒØ´Ù„ Ú©ÛŒÚ–ÙŠØ› Ù„ÙˆÙ…Ú“ÛŒ Ø¹Ù†ØµØ± Û±/Û´ Ø§Ùˆ Ø¯ÙˆÛŒÙ… Ø¹Ù†ØµØ± Û³/Û´ Ø¯ Ù¾Ø§ØªÛ ÚØ§ÛŒ Ú…Ø®Ù‡ Ø§Ø´ØºØ§Ù„ÙˆÙŠ.</p><p>Ø¯Ù„ØªÙ‡ØŒ Ø®ÙˆØ±Ù‡ Ø¯ Ø³ØªØ§Ø³Ùˆ Ø¯ Ù„ÙˆÙ…Ú“ÙŠ Ù‚Ø·Ø§Ø± Ú©ÛŒÚ¼ Ø§Ú“Ø® Û±/Û¶ Ø¬ÙˆÚ“ÙˆÙŠ Ø§Ùˆ Ú«Ø§Ø²Ø±Ø§Ù† Ù¾Ø§ØªÛ Ûµ/Û¶ Ø¬ÙˆÚ“ÙˆÙŠ. Ø¯ Ø¯Û Ù¾Ø±Ø§Ø®Ùˆ Ø³Ø±Ù‡ Ø¯ÙˆÙ‡ Ú©Ø§Ù„Ù…ÙˆÙ†Ù‡ Ø¬ÙˆÚ“ Ú©Ú“Ø¦ Ú†Û Ø¯ <code>fr</code> ÙˆØ§Ø­Ø¯ÙˆÙ†Ùˆ Ø³Ø±Ù‡ ÙˆÙŠ.</p>',
