      'zh-tw': '<p>ç•¶è¡Œçš„å¯¬åº¦æŽ¡ç”¨åƒç´ ã€ç™¾åˆ†æ¯”æˆ–è€… em ç‚ºå–®ä½çš„æ™‚å€™ï¼Œå…¶ä»–ä½¿ç”¨ <code>fr</code> å–®ä½è¨­ç½®çš„è¡Œå°‡æœƒå¹³åˆ†å‰©ä¸‹çš„ç©ºé–“ã€‚</p><p>é€™è£¡çš„èƒ¡è˜¿è””åœ¨å·¦é‚Šå½¢æˆäº†ä¸€å€‹ 50 åƒç´ çš„è¡Œï¼Œä¸¦ä¸”é›œè‰åœ¨å³é‚Šä¹Ÿä½”æ“š 50 åƒç´ çš„å¯¬åº¦ã€‚ä½¿ç”¨ <code>grid-template-columns</code> å±¬æ€§ï¼Œå‰µå»ºé€™å…©å€‹è¡Œï¼Œä½¿ç”¨ <code>fr</code> å†å‰µå»ºä¸‰å€‹è¡Œï¼Œä½¿å…¶å¹³å‡ä½”æ“šå‰©ä¸‹çš„ç©ºé–“ã€‚</p>',
      'tr': '<p> Kolonlar piksel, yÃ¼zdeler veya em ile ayarlandÄ±ÄŸÄ±nda, <code>fr</code> ile ayarlanmÄ±ÅŸ diÄŸer sÃ¼tunlar, kalan alanÄ± paylaÅŸÄ±r.</p><p> Burada havuÃ§ solda 50 piksel kolon, yabani otlar ise saÄŸda 50 piksel kolon oluÅŸturmaktadÄ±r. <code>grid-template-columns</code> ile, bu iki kolonu oluÅŸturun ve kalan boÅŸluÄŸu dolduracak Ã¼Ã§ kolon daha oluÅŸturmak iÃ§in <code>fr</code> kullanÄ±n.</p>',
      'az': '<p> SÃ¼tunlar piksel, faiz vÉ™ya em ilÉ™ tÉ™yin edildikdÉ™, <code>fr</code> ilÉ™ tÉ™yin edilmiÅŸ digÉ™r sÃ¼tunlar, geridÉ™ qalan sahÉ™ni paylaÅŸÄ±r.</p><p> Burada kÃ¶k solda 50 piksel sÃ¼tun, yabani otlar isÉ™ saÄŸda 50 piksel sÃ¼tun É™hatÉ™ etmÉ™kdÉ™dir. <code>grid-template-columns</code> ilÉ™, bu iki sÃ¼tunu yaradÄ±n vÉ™ geridÉ™ qalan boÅŸluÄŸu dolduracaq Ã¼Ã§ sÃ¼tun da yaratmaq Ã¼Ã§Ã¼n <code>fr</code> istifadÉ™ edin.</p>',
      'fr': '<p>Lorsque les colonnes sont dÃ©finies avec des pixels, des pourcentages ou des ems, toutes les autres colonnes dÃ©finies avec <code>fr</code> se rÃ©partiront l\'espace restant.</p><p>Ici, les carottes forment une colonne de 50 pixels sur la gauche et les mauvaises herbes une colonne de 50 pixels sur la droite. Avec <code>grid-template-columns</code>, crÃ©ez ces deux colonnes et utilisez <code>fr</code> pour crÃ©er trois colonnes supplÃ©mentaires qui occupent l\'espace restant entre les deux.</p>',
      'de': '<p>Wenn Spalten mit Pixel, Prozentwerten oder ems definiert wurden, wird jede weitere Spalte, die mit <code>fr</code> angegeben wird, den verbleibenden Platz aufteilen.</p><p>Hier bilden die Karotten eine 50 Pixel breite Spalte auf der linken Seite und das Unkraut eine 50 Pixel breite Spalte auf der rechten Seite. Erstelle diese zwei Spalten mit <code>grid-template-columns</code> und benutze <code>fr</code> um drei weitere Spalten zu erstellen, die den verbleibenden Platz dazwischen ausfÃ¼llen.</p>',
      'nl': '<p>Wanneer kolommen worden ingesteld met pixels, percentages of ems, zullen alle andere kolommen die met <code>fr</code> zijn ingesteld de resterende ruimte verdelen.</p><p>Hier vormen de wortels een 50-pixels kolom aan de linkerkant, en het onkruid een 50-pixels kolom aan de rechterkant. Maak met <code>grid-template-columns</code> deze twee kolommen, en gebruik <code>fr</code> om drie extra kolommen te maken die de ruimte ertussenin opvullen.</p>',
      'pt-br': '<p>Quando as colunas sÃ£o especificadas com pixels, porcentagens, ou ems, qualquer outra coluna definida com <code>fr</code> vai dividir o espaÃ§o que sobrou.</p><p>Aqui as cenouras formam uma coluna de 50 pixels na esquerda, e as ervas daninhas uma coluna de 50 pixels na direita. Com <code>grid-template-columns</code>, crie essas duas colunas, e use <code>fr</code> para fazer mais trÃªs colunas que ocuparÃ£o o espaÃ§o sobrando no meio.</p>',
