      'pl': '<p>Kiedy kolumny majÄ… wymiar podany w pixelach, procentach lub em-ach, kaÅ¼da inna kolumna podana w jednostce <code>fr</code> podzieli pozostaÅ‚Ä… przestrzeÅ„.</p><p>W tym miejscu marchewki tworzÄ… 50 pixelowÄ… kolumnÄ™ po lewej stronie, a chwasty 50 pixelowÄ… kolumnÄ™ po prawej. Przy pomocy <code>grid-template-columns</code>, stwÃ³rz te dwie kolumny i uÅ¼yj <code>fr</code>, by stworzyÄ‡ trzy kolejne kolumny, ktÃ³re zajmÄ… pozostaÅ‚Ä… przestrzeÅ„.</p>',
