      'it': '<p>Quando le colonne sono definite in pixel, percentuale o em, ogni altra colonna definita con <code>fr</code> suddividerÃ  lo spazio restante.</p><p>Qui le carote occupano una colonna di 50 pixel a sinistra e le erbacce occupano una colonna di 50 pixel a destra. Con <code>grid-template-columns</code>, crea queste due colonne, e usa <code>fr</code> per creare tre nuove colonne che occupino lo spazio rimanente nel mezzo.</p>',
