      'al': '<p><code>grid-template</code> Ã«shtÃ« njÃ« metodÃ« qÃ« kombinon <code>grid-template-rows</code> dhe <code>grid-template-columns</code>.</p><p>PÃ«r shembull, <code>grid-template: 50% 50% / 200px;</code> do tÃ« krijojÃ« njÃ« grid me dy rrjeshta qÃ« janÃ« 50% secili, dhe njÃ« kolonÃ« e cila Ã«shtÃ« 200 pixel e gjerÃ«.</p><p>Provoni tÃ« pÃ«rdorni <code>grid-template</code> pÃ«r tÃ« ujitur njÃ« zonÃ« qÃ« pÃ«rfshin 60% tÃ« fillimit lartÃ« dhe 200 pixel nÃ« tÃ« majtÃ« tÃ« kopÃ«shtit tuaj.</p>',
      'et': '<p><code>grid-template</code> on lÃ¼hend omadus, mis Ã¼hendab <code>grid-template-rows</code> ja <code>grid-template-columns</code>.</p><p>NÃ¤iteks, <code>grid-template: 50% 50% / 200px;</code> Ã¶loob ruudustiku kahe 50% reaga, ja Ã¼he veeru, mis on 200 pikslit lai.</p><p>Proovi kasutada <code>grid-template</code> kasta ala, mis hÃµlmab teie aia Ã¼lemist 60% ja vasakut 200 pikslit.</p>',
      'th': '<p><code>grid-template</code> à¹€à¸›à¹‡à¸™à¸„à¸¸à¸“à¸ªà¸¡à¸šà¸±à¸•à¸´à¸¢à¹ˆà¸­à¸—à¸µà¹ˆà¸£à¸§à¸¡à¸„à¸¸à¸“à¸ªà¸¡à¸šà¸±à¸•à¸´ <code>grid-template-rows</code> à¹à¸¥à¸° <code>grid-template-columns</code> à¹€à¸‚à¹‰à¸²à¸”à¹‰à¸§à¸¢à¸à¸±à¸™</p><p>à¸¢à¸à¸•à¸±à¸§à¸­à¸¢à¹ˆà¸²à¸‡à¹€à¸Šà¹ˆà¸™ <code>grid-template: 50% 50% / 200px;</code> à¸ˆà¸°à¸ªà¸£à¹‰à¸²à¸‡ grid à¸—à¸µà¹ˆà¸¡à¸µ 2 rows à¸—à¸µà¹ˆà¸¡à¸µà¸„à¸§à¸²à¸¡à¸ªà¸¹à¸‡à¹à¸•à¹ˆà¸¥à¸°à¸•à¸±à¸§ 50%, à¹à¸¥à¸° 1 column à¸—à¸µà¹ˆà¸¡à¸µà¸„à¸§à¸²à¸¡à¸à¸§à¹‰à¸²à¸‡à¸‚à¸™à¸²à¸” 200 à¸žà¸´à¸à¹€à¸‹à¸¥</p><p>à¸¥à¸­à¸‡à¹ƒà¸Šà¹‰à¸„à¸¸à¸“à¸ªà¸¡à¸šà¸±à¸•à¸´ <code>grid-template</code> à¹€à¸žà¸·à¹ˆà¸­à¸£à¸”à¸™à¹‰à¸³à¸žà¸·à¹‰à¸™à¸—à¸µà¹ˆà¸—à¸µà¹ˆà¸£à¸§à¸¡ 60% à¸ˆà¸²à¸à¸”à¹‰à¸²à¸™à¸šà¸™à¸ªà¸¸à¸” à¹à¸¥à¸° 200 à¸žà¸´à¸à¹€à¸‹à¸¥à¸ˆà¸²à¸à¸”à¹‰à¸²à¸™à¸‹à¹‰à¸²à¸¢à¸ªà¸¸à¸”à¸‚à¸­à¸‡à¸ªà¸§à¸™à¸‚à¸­à¸‡à¸„à¸¸à¸“</p>',
      'yo': '<p><code>grid-template</code> jáº¹Ì ohun-Ã¬nÃ­ á»wá»Ì kÃºkÃºrÃº tÃ­ Ã³ á¹£opá»Ì€ <code>grid-template-rows</code> Ã ti <code> grid-template-columns</code>. </p><p>Fun apáº¹áº¹ráº¹, <code>grid-template: 50% 50% / 200px;</code> yoo á¹£áº¹da grid páº¹lu awá»n ori ila meji ti o jáº¹ 50% ká»á»kan, ati iwe kan ti o jáº¹ 200 pixels fifáº¹. </p><p>Gbiyanju lilo <code>grid-template</code> lati fun omi agbegbe ti o ni oke 60% ati osi 200 pixels ti á»gba ráº¹.</p>',
      'sk': '<p><code>grid-template</code> je skrÃ¡tenÃ¡ vlastnosÅ¥, ktorÃ¡ kombinuje <code>grid-template-rows</code> a <code>grid-template-columns</code>.</p><p>NaprÃ­klad <code>grid-template: 50% 50% / 200px;</code> vytvorÃ­ mrieÅ¾ku s dvoma riadkami, z ktorÃ½ch kaÅ¾dÃ½ mÃ¡ 50%, a jednÃ½m stÄºpcom so Å¡Ã­rkou 200 pixlov.</p><p>VyskÃºÅ¡ajte pouÅ¾iÅ¥ Å¡ablÃ³nu <code>grid-template</code> na zalievanie oblasti, ktorÃ¡ zahÅ•Åˆa hornÃ½ch 60% a Ä¾avÃ½ch 200 pixelov vaÅ¡ej zÃ¡hrady.</p>',
      'ta': '<p><code>grid-template</code> à®Žà®©à¯à®ªà®¤à¯ <code>grid-template-rows</code> à®®à®±à¯à®±à¯à®®à¯ <code>grid-template-columns</code> à®†à®•à®¿à®¯à®µà®±à¯à®±à¯ˆ à®‡à®£à¯ˆà®•à¯à®•à¯à®®à¯ à®’à®°à¯ à®šà¯à®°à¯à®•à¯à®•à¯†à®´à¯à®¤à¯à®¤à¯ à®šà¯Šà®¤à¯à®¤à¯.</p><p>à®Žà®Ÿà¯à®¤à¯à®¤à¯à®•à¯à®•à®¾à®Ÿà¯à®Ÿà®¾à®•, <code>grid-template: 50% 50% / 200px;</code> à®†à®©à®¤à¯ à®‡à®°à®£à¯à®Ÿà¯ à®µà®°à®¿à®šà¯ˆà®•à®³à¯ à®’à®µà¯à®µà¯Šà®©à¯à®±à¯à®®à¯ 50% à®®à®±à¯à®±à¯à®®à¯ à®’à®°à¯ à®¨à¯†à®Ÿà¯à®µà®°à®¿à®šà¯ˆ 200 à®ªà®¿à®•à¯à®šà®²à¯à®•à®³à¯ à®…à®•à®²à®®à¯ à®•à¯Šà®£à¯à®Ÿ à®•à®Ÿà¯à®Ÿà®¤à¯à®¤à¯ˆ à®‰à®°à¯à®µà®¾à®•à¯à®•à¯à®®à¯.</p><p>à®‰à®™à¯à®•à®³à¯ à®¤à¯‹à®Ÿà¯à®Ÿà®¤à¯à®¤à®¿à®©à¯ à®®à¯‡à®²à¯ 60% à®®à®±à¯à®±à¯à®®à¯ à®‡à®Ÿà®¤à¯à®ªà¯à®±à®®à¯ 200 à®ªà®¿à®•à¯à®šà®²à¯à®•à®³à¯ˆ à®‰à®³à¯à®³à®Ÿà®•à¯à®•à®¿à®¯ à®ªà®•à¯à®¤à®¿à®•à¯à®•à¯ à®¤à®£à¯à®£à¯€à®°à¯ à®µà®´à®™à¯à®• <code>grid-template</code> à®ªà®¯à®©à¯à®ªà®Ÿà¯à®¤à¯à®¤à®µà¯à®®à¯.</p>',
      'ur': '<p><code>grid-template</code> Ø§ÛŒÚ© Ø´Ø§Ø±Ù¹ ÛÛŒÙ†Úˆ Ù¾Ø±Ø§Ù¾Ø±Ù¹ÛŒ ÛÛ’ Ø¬Ùˆ <code>grid-template-rows</code> Ø§ÙˆØ± <code>grid-template-columns</code> Ú©Ùˆ ÛŒÚ©Ø¬Ø§ Ú©Ø±ØªÛŒ ÛÛ’Û”</p><p>Ù…Ø«Ø§Ù„ Ú©Û’ Ø·ÙˆØ± Ù¾Ø±ØŒ <code>grid-template: 50% 50% / 200px;</code> Ø¯Ùˆ Ù‚Ø·Ø§Ø±ÛŒÚº Ø¨Ù†Ø§Ø¦Û’ Ú¯Ø§ Ø¬Ùˆ ÛØ± Ø§ÛŒÚ© 50% Ú©ÛŒ ÛÙˆÚº Ú¯ÛŒØŒ Ø§ÙˆØ± Ø§ÛŒÚ© Ú©Ø§Ù„Ù… Ø¬Ùˆ 200 Ù¾Ú©Ø³Ù„Ø² Ú†ÙˆÚ‘Ø§ ÛÙˆÚ¯Ø§Û”</p><p><code>grid-template</code> Ú©Ø§ Ø§Ø³ØªØ¹Ù…Ø§Ù„ Ú©Ø±ØªÛ’ ÛÙˆØ¦Û’ Ø§Ø³ Ø¹Ù„Ø§Ù‚Û’ Ú©Ùˆ Ù¾Ø§Ù†ÛŒ Ø¯ÛŒÙ†Û’ Ú©ÛŒ Ú©ÙˆØ´Ø´ Ú©Ø±ÛŒÚº Ø¬Ùˆ Ø¢Ù¾ Ú©Û’ Ø¨Ø§Øº Ú©Û’ Ø§ÙˆÙ¾Ø±ÛŒ 60% Ø§ÙˆØ± Ø¨Ø§Ø¦ÛŒÚº Ø¬Ø§Ù†Ø¨ 200 Ù¾Ú©Ø³Ù„Ø² Ù¾Ø± Ù…Ø­ÛŒØ· ÛÙˆÛ”</p>',
      'ps': '<p><code>grid-template</code> ÛŒÙˆÙ‡ Ù„Ù†Ú‰ÛŒØ² Ù…Ù„Ú©ÛŒØª Ø¯ÛŒ Ú†Û Ø¯ <code>grid-template-rows</code> Ø§Ùˆ <code>grid-template-columns</code> ØªØ±Ú©ÛŒØ¨ Ú©ÙˆÙŠ.</p><p>Ø¯ Ù…Ø«Ø§Ù„ Ù¾Ù‡ ØªÙˆÚ«Ù‡ØŒ <code>grid-template: 50% 50% / 200px;</code> Ø¨Ù‡ ÛŒÙˆ Ø´Ø¨Ú©Ù‡ Ø±Ø§Ù…Ù†ÚØªÙ‡ Ú©Ú“ÙŠ Ú†Û Ø¯ÙˆÙ‡ Ù‚Ø·Ø§Ø±ÙˆÙ†Ù‡ ÛŒÛ Ù‡Ø± ÛŒÙˆ ÛµÛ°Ùª ÙˆÙŠØŒ Ø§Ùˆ ÛŒÙˆ Ú©Ø§Ù„Ù… Ú†Û Û²Û°Û° Ù¾Ú©Ø³Ù„ÙˆÙ†Ù‡ Ù¾Ù„Ù† Ø¯ÛŒ.</p><p>Ø¯ <code>grid-template</code> ÙˆÚ©Ø§Ø±ÙˆØ¦ ØªØ±Ú…Ùˆ ÛŒÙˆÙ‡ Ø³Ø§Ø­Ù‡ Ø§ÙˆØ¨Ù‡ Ú©Ú“Ø¦ Ú†Û Ø¯ Ø¨Ø§Øº Ù¾Ù‡ Ø³Ø± Ú©Û Û¶Û°Ùª Ø§Ùˆ Ú©ÛŒÚ¼ Ù„ÙˆØ± Ú©Û Û²Û°Û° Ù¾Ú©Ø³Ù„ÙˆÙ†Ù‡ Ø´Ø§Ù…Ù„ ÙˆÙŠ.</p>',
